Let's search for a song that has a title similar to: "hello" curl http://localhost:18425 -d '{"jsonrpc":"2.0","id":0,"method":"search_song","params":{"input":"hello","kind":"top1"}}' The output gives us back a Song object, which contains some keys: { "jsonrpc": "2.0", "result": { "songs": [ { "title": "HELLO", "key": 15850, // <--- This is the `Song`'s key "album": 737, // <--- This is the key of the `Album` this `Song` belongs too "runtime": 243, "sample_rate": 44100, "track": 8, "disc": 1, "mime": "audio/x-flac", "extension": "flac" } ] }, "id": 0
} We can now use that Album key to get the Album: curl http://localhost:18425 -d '{"jsonrpc":"2.0","id":0,"method":"key_album","params":{"key":"737"}}' And we get the Album object back: { "jsonrpc": "2.0", "result": { "title": "Hero", "key": 737, // <--- This is the `Album`'s key "artist": 196, // <--- This is the key of the `Artist` this `Album` belongs too "release": "2001-12-29", "runtime": 4676, "song_count": 3, "songs": [ 15850, // <--- Hey look, it's the original `Song` key 9771, 15853 ], "discs": 0, "art": 8348685, "genre": null }, "id": 0
} We can now use that Artist key to get the Artist: curl http://localhost:18425 -d '{"jsonrpc":"2.0","id":0,"method":"key_artist","params":{"key":"196"}}' And we get the Artist object back: { "jsonrpc": "2.0", "result": { "name": "Tac", "key": 196, // <--- This is the `Artist`' key "runtime": 15636, "albums": [ 737, // <--- Hey look, it's the original `Album` key ], "songs": [ 15850, // <--- Hey look, it's the original `Song` key 9771, 15853 ] }, "id": 0
} With these keys, you traverse up and down the relational graph.

